import React from 'react';

import './currency-list-item.css';

const CurrencyListItem = ({data}) => {
	return (
		<React.Fragment>
			<li className="currencyListItem">USD</li>
			<li className="currencyListItem">USD</li>
			<li className="currencyListItem">USD</li>
		</React.Fragment>
	);
};

export default CurrencyListItem;
